/* eslint-disable jsx-a11y/anchor-is-valid */
import React from 'react';
import 'bootstrap/dist/css/bootstrap.min.css';

const Navbar = () => {
  return (
    <nav className="navbar navbar-expand-lg navbar-light bg-light">
      <a className="navbar-brand" href="#">Áreas de Trabajo</a>
      <button className="navbar-toggler" type="button" data-toggle="collapse" data-target="#navbarSupportedContent" aria-controls="navbarSupportedContent" aria-expanded="false" aria-label="Toggle navigation">
        <span className="navbar-toggler-icon"></span>
      </button>

      <div className="collapse navbar-collapse" id="navbarSupportedContent">
        <ul className="navbar-nav mr-auto">
          <li className="nav-item active">
            <a className="nav-link" href="#desarrollo">Desarrollo <span className="sr-only">(current)</span></a>
          </li>
          <li className="nav-item">
            <a className="nav-link" href="#diseño">Diseño</a>
          </li>
          <li className="nav-item">
            <a className="nav-link" href="#marketing">Marketing</a>
          </li>
          <li className="nav-item">
            <a className="nav-link" href="#finanzas">Finanzas</a>
          </li>
          <li className="nav-item">
            <a className="nav-link" href="#recursos-humanos">Recursos Humanos</a>
          </li>
        </ul>
      </div>
    </nav>
  );
};

export default Navbar;
